import React from 'react';
import './App.css';
//import $ from 'jquery';

function App() {
  return (
      <header className="App-header">
        <div className="App-logo">
        <p>HH</p>
        </div>
        <p className="App-title">
        Huutoniemen Hoki
        </p>
      </header>
  );
}

export default App;
